import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import Login from './components/Login';
import Dashboard from './components/Dashboard';
import ExpertRegistration from './components/ExpertRegistration';
import DspRegistration from './components/DspRegistration';
import WorkplaceRegistration from './components/WorkplaceRegistration';
import Accounting from './components/Accounting';
import DataImport from './components/DataImport';
import ExpertCardPage from './components/ExpertCardPage';
import DoctorCardPage from './components/DoctorCardPage';
import DspCardPage from './components/DspCardPage';
import Navbar from './components/Navbar';
import './App.css';

function App() {
  return (
    <Router>
      <div className="app">
        <Routes>
          <Route path="/" element={<Login />} />
          <Route path="/dashboard" element={<Dashboard />} />
          <Route path="/experts" element={<><Navbar /><ExpertCardPage /></>} />
          <Route path="/doctors" element={<><Navbar /><DoctorCardPage /></>} />
          <Route path="/dsps" element={<><Navbar /><DspCardPage /></>} />
          <Route path="/workplaces" element={<><Navbar /><WorkplaceRegistration /></>} />
          <Route path="/accounting" element={<><Navbar /><Accounting /></>} />
          <Route path="/data" element={<><Navbar /><DataImport /></>} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
